### Core Characteristics
- Companies between 100 and 1,000 employees with dedicated revenue teams
- North America, UK, DACH, and ANZ with English-first prospecting
- Leadership titles: VP Sales, CRO, VP RevOps, Heads of Growth
- Invest in Salesforce, HubSpot, or close variants with API access
- Willing to blend AI autonomy with human review for enterprise-grade outreach

### Buying Triggers
- SDR hiring freeze or team attrition above 25%
- Manual prospect research exceeds 6 hours per campaign
- Existing tools (Apollo, Sales Navigator) do not personalize at scale
- Leadership requests omnichannel sequencing but team uses email only
- Pipeline coverage below 3 target for two consecutive quarters

### Competitive Posture
SAM wins when prospects value: speed-to-campaign, autonomous research, single orchestrator for LinkedIn + email + n8n. We lose when prospects insist on point tools or lack change management capacity.', '{"seedGroup": "sam-demo"}', '{ICP,targeting,playbook}', '{ICP,targeting,playbook}', 'document', '["Ideal prospects operate revenue teams of 15+ sellers and feel hiring pressure.", "Best-fit verticals: B2B SaaS, GTM agencies, RevOps consultancies, enterprise marketplaces.", "Buying signals include rapid SDR turnover, multi-channel outreach gaps, and heavy manual research."]', 'Defines the ideal customer profile for SAM AI including verticals, signals, and decision makers.', 0.92, 'icp', '{"seeded": true}', 'processed', '2025-09-26 15:08:18.073+00', 1, '2025-09-26 15:08:18.409+00', NULL, '2025-09-26 15:08:18.073+00', '2025-09-26 15:08:18.073+00', 'icp'),
	('24b09668-3aa7-4a47-b76b-30e72f09fe38', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', 'products', 'sam-product-overview.md', 'sam-product-overview.md', 'text/markdown', 1119, 'seed://24b09668-3aa7-4a47-b76b-30e72f09fe38', '# SAM AI Platform Overview

## Agentic Architecture
1. Consultant Orchestrator (Sam)  drives discovery, KB capture, strategy, and approvals.
2. Prospect Intelligence Agent  executes Google CSE, Bright Data, and Unipile sourcing.
3. Knowledge Curator  parses uploads, tags sections, vectors into Supabase pgvector.
4. Campaign Builder  assembles channel steps, personalizes templates, schedules via n8n.
5. Inbox & Reply Agent  triages responses, drafts follow-ups, escalates to humans.

## Feature Highlights
- Real-time ICP validation with live LinkedIn samples
- Drag-and-drop knowledge ingestion (pitch decks, FAQs, pricing) feeding RAG
- Multi-tenant safe: each workspace isolated with RLS and proxy routing
- Approval console to enforce HITL before large sends
- End-to-end analytics baked into Supabase + Tremor dashboards

## Security & Compliance
- Row-level security driven by workspace membership
- OAuth / Hosted Auth for LinkedIn accounts via Unipile
- Email sending through customer-owned reach inbox or Google/Microsoft
- Audit logging on every automation step (campaigns, approvals, template edits).', '{"seedGroup": "sam-demo"}', '{product,features,architecture}', '{product,features,architecture}', 'document', '["SAM runs a consultant orchestrator that assigns work to specialized agents (prospecting, KB curation, messaging, approval).", "Channels: LinkedIn (via Unipile MCP), email (ReachInbox + Google/Microsoft), enrichment (Bright Data, Apify, Google CSE).", "Compliance: workspace isolation, Netlify + Supabase stack, optional HITL checkpoints at every stage."]', 'Explains SAM AIs orchestrated agent stack, channels, and compliance posture.', 0.92, 'products', '{"seeded": true}', 'processed', '2025-09-26 15:08:18.59+00', 2, '2025-09-26 15:08:19.588+00', NULL, '2025-09-26 15:08:18.59+00', '2025-09-26 15:08:18.59+00', 'products'),
