## LinkedIn Steps
1. **Connection Note (Day 0)**  220 characters max, reference shared KPI or recent funding.
2. **Value Drop (Day 2)**  short voice of customer quote + CTA to see autonomous campaign.
3. **Pattern Interrupt (Day 5)**  curiosity angle about agentic workflows replacing manual SDR workflows.

## Email Steps
- **Email 1:** Problem framing, highlight time saved per campaign, link to 3-slide primer.
- **Email 2:** Case study snippet (target vertical), emphasize multi-channel orchestration.
- **Email 3:** Objection handling ("we already use Apollo") with integration story.

## Personalization Inputs
- Industry modifiers (SaaS: ARR churn, Services: bench utilization).
- Persona tweaks (VP Sales vs RevOps: team efficiency vs visibility).
- Knowledge base references (use uploaded doc snippets as proof).', '{"seedGroup": "sam-demo"}', '{messaging,linkedin,email}', '{messaging,linkedin,email}', 'document', '["Each sequence begins with a consultant-style connect request referencing KB insights.", "Follow-ups blend ICP-specific pains (research debt, SDR turnover) with social proof.", "Messaging adapts to vertical (SaaS vs agency) by switching case studies and metrics."]', 'Provides the default LinkedIn + email outreach cadence and personalization levers.', 0.92, 'messaging', '{"seeded": true}', 'processed', '2025-09-26 15:08:19.76+00', 1, '2025-09-26 15:08:20.055+00', NULL, '2025-09-26 15:08:19.76+00', '2025-09-26 15:08:19.76+00', 'messaging'),
	('1424011e-1f1b-419d-a767-6c5e8b45cc90', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', 'objections', 'sam-objection-handling-matrix.md', 'sam-objection-handling-matrix.md', 'text/markdown', 885, 'seed://1424011e-1f1b-419d-a767-6c5e8b45cc90', '## Objection Playbook

### 1. "We already use Apollo"
- **Reframe:** Apollo = database; SAM = orchestration + personalization.
- **Data Point:** Customers report 65% faster launch because agents do research + copy.
- **CTA:** Offer to plug Apollo data into SAMs agents for head-to-head A/B.

### 2. "AI is risky for our brand"
- **Reframe:** SAM maintains KB guardrails + human approvals.
- **Evidence:** HITL approval queue + audit trail (show screenshot).
- **CTA:** Suggest running 10-prospect pilot with manual approval to build trust.

### 3. "We need human review"
- **Reframe:** SAM bakes humans into orchestrated steps (pre-send approval, reply desk).
- **CTA:** Demo approval UX, highlight Slack alerts for anomalies.

### 4. "Data privacy?"
- **Reframe:** Workspaces isolated via Supabase RLS + customer-controlled tokens.
- **CTA:** Share security datasheet + optional DPA.', '{"seedGroup": "sam-demo"}', '{objections,sales,enablement}', '{objections,sales,enablement}', 'document', '["Primary objections: We already use Apollo, AI feels risky, Need HITL, Data privacy.", "Talk tracks convert objection into benefit, then cite KB upload or case study.", "Always include fallback step: schedule 20-min GTM audit with Sam orchestrator."]', 'List of common buying objections with talk tracks and KB references.', 0.92, 'objections', '{"seeded": true}', 'processed', '2025-09-26 15:08:20.22+00', 1, '2025-09-26 15:08:20.596+00', NULL, '2025-09-26 15:08:20.22+00', '2025-09-26 15:08:20.22+00', 'objections'),
