	('b57622b8-cdf4-4342-9245-526fc700c790', 'sam_signature', 'SAM Signature Funnel - Technology', 'Our highest-converting sequence optimized for technology companies', 'technology', 'cto', 'mid_market', 'sam-signature-tech-v1', NULL, 0, 23.50, 18.20, NULL, 5, NULL, NULL, NULL, true, true, NULL, '{high_converting,technology,b2b}', '2025-09-23 22:16:31.862141', '2025-09-23 22:16:31.862141'),
	('4f76beb3-fd2d-4b83-b76e-947f86a60cce', 'sam_signature', 'SAM Signature Funnel - Healthcare', 'Proven sequence tailored for healthcare industry prospects', 'healthcare', 'ceo', 'enterprise', 'sam-signature-healthcare-v1', NULL, 0, 21.80, 16.70, NULL, 6, NULL, NULL, NULL, true, true, NULL, '{healthcare,compliance_ready,b2b}', '2025-09-23 22:16:31.862141', '2025-09-23 22:16:31.862141'),
	('96b4ad40-1614-477e-81b3-e44041e62752', 'event_invitation', 'Event Invitation Funnel - General', 'Perfect for webinars, conferences, and product demos', 'general', 'general', 'general', 'event-invitation-general-v1', NULL, 0, 24.10, 19.30, NULL, 4, NULL, NULL, NULL, true, NULL, NULL, '{events,webinars,general}', '2025-09-23 22:16:31.862141', '2025-09-23 22:16:31.862141'),
	('85daa7cb-0fff-4837-9e6a-df0877f3bde4', 'sam_signature', 'SAM Complete Intelligence Funnel - Technology', 'Full data scraping, enrichment, and personalization pipeline for technology companies using all MCP integrations', 'technology', 'cto', 'mid_market', 'sam-complete-intelligence-tech-v1', '{"nodes": [{"id": "trigger", "name": "Campaign Trigger", "type": "webhook", "position": [100, 100], "parameters": {"path": "sam-campaign-start", "options": {}, "responseMode": "responseNode"}, "typeVersion": 1}, {"id": "websearch_boolean", "name": "Boolean LinkedIn Search", "type": "mcp-websearch", "position": [300, 100], "parameters": {"query": "{{ $json.search_criteria.boolean_query }}", "filters": {"industry": "technology", "geography": "United States", "jobTitles": ["CTO", "VP Engineering", "Head of Technology"]}, "operation": "boolean_linkedin_search", "maxResults": 50, "includeSnippets": true}, "typeVersion": 1}, {"id": "websearch_company", "name": "Company Intelligence Research", "type": "mcp-websearch", "position": [500, 100], "parameters": {"operation": "company_intelligence_search", "maxResults": 15, "searchType": "comprehensive", "companyName": "{{ $json.company_name }}", "includeAnalysis": true}, "typeVersion": 1}, {"id": "apify_apollo", "name": "Apollo Contact Extraction", "type": "mcp-apify", "position": [700, 100], "parameters": {"input": {"filters": {"industries": ["Software", "SaaS", "Technology"], "job_titles": ["CTO", "VP Engineering", "Director Technology"], "technologies": ["AWS", "React", "Node.js", "Python"], "company_sizes": ["51-200", "201-500", "501-1000"]}, "maxResults": 100, "searchType": "people", "qualityFilters": {"emailConfidence": "high", "recentlyUpdated": 90, "verifiedContacts": true}, "includeContactInfo": true}, "actorId": "apollo-io-scraper"}, "typeVersion": 1}, {"id": "brightdata_linkedin", "name": "Cost-Optimized LinkedIn Scraping", "type": "mcp-brightdata", "position": [100, 300], "parameters": {"operation": "scrape_linkedin_profiles", "proxy_type": "residential", "data_points": ["full_profile", "current_position", "work_history", "education", "skills", "contact_info"], "profile_urls": "{{ $json.linkedin_urls }}", "scraper_type": "linkedin_scraper_api"}, "typeVersion": 1}, {"id": "brightdata_company", "name": "Company Website Intelligence", "type": "mcp-brightdata", "position": [300, 300], "parameters": {"domains": "{{ $json.company_domains }}", "location": "US", "operation": "scrape_company_websites", "extract_data": {"recent_news": ".news-section, .press-releases", "job_postings": "a[href*=\"careers\"], a[href*=\"jobs\"]", "pricing_info": ".pricing, .plans", "product_info": ".products, .solutions", "employee_count": ".employee-count, .company-size", "company_description": "meta[name=\"description\"]"}, "session_type": "high_performance"}, "typeVersion": 1}, {"id": "unipile_verification", "name": "Multi-Channel Contact Verification", "type": "mcp-unipile", "position": [500, 300], "parameters": {"channels": ["linkedin", "email", "phone"], "contacts": "{{ $json.enriched_contacts }}", "operation": "verify_contacts_multi_channel", "check_social_presence": true, "verify_deliverability": true, "analyze_engagement_history": true}, "typeVersion": 1}, {"id": "data_fusion", "name": "Multi-Source Data Fusion", "type": "function", "position": [700, 300], "parameters": {"functionCode": "\n                  // Intelligent data fusion from all MCP sources\n                  const webSearchData = $(''websearch_boolean'').first();\n                  const apolloData = $(''apify_apollo'').first();\n                  const linkedinData = $(''brightdata_linkedin'').first();\n                  const companyData = $(''brightdata_company'').first();\n                  const verificationData = $(''unipile_verification'').first();\n                  \n                  const fusedProspects = [];\n                  \n                  // Combine and score prospects from all sources\n                  const allProspects = [\n                    ...(webSearchData.prospects || []),\n                    ...(apolloData.contacts || []),\n                    ...(linkedinData.profiles || [])\n                  ];\n                  \n                  for (const prospect of allProspects) {\n                    // Calculate qualification score\n                    const icpScore = calculateICPScore(prospect);\n                    const intentScore = calculateIntentScore(companyData, prospect);\n                    const verificationScore = calculateVerificationScore(verificationData, prospect);\n                    \n                    const qualificationScore = Math.round(\n                      (icpScore * 0.4) + \n                      (intentScore * 0.3) + \n                      (verificationScore * 0.3)\n                    );\n                    \n                    if (qualificationScore >= 60) {\n                      fusedProspects.push({\n                        ...prospect,\n                        qualification_score: qualificationScore,\n                        data_sources: [''websearch'', ''apollo'', ''linkedin'', ''company_intel''],\n                        recommended_channels: getRecommendedChannels(prospect, qualificationScore),\n                        personalization_data: extractPersonalizationData(prospect, companyData)\n                      });\n                    }\n                  }\n                  \n                  return fusedProspects.sort((a, b) => b.qualification_score - a.qualification_score);\n                  \n                  function calculateICPScore(prospect) {\n                    let score = 0;\n                    if ([''CTO'', ''VP'', ''Director'', ''Head of''].some(title => prospect.title?.includes(title))) score += 40;\n                    if ([''Software'', ''SaaS'', ''Technology''].includes(prospect.industry)) score += 30;\n                    if (prospect.company_size >= 50 && prospect.company_size <= 1000) score += 20;\n                    if (prospect.funding_stage) score += 10;\n                    return score;\n                  }\n                  \n                  function calculateIntentScore(companyData, prospect) {\n                    let score = 0;\n                    if (companyData.job_postings?.length > 0) score += 30;\n                    if (companyData.recent_funding) score += 25;\n                    if (companyData.technology_stack?.includes(''cloud'')) score += 20;\n                    if (prospect.recent_job_change) score += 25;\n                    return score;\n                  }\n                  \n                  function calculateVerificationScore(verificationData, prospect) {\n                    let score = 0;\n                    if (verificationData.email_deliverable) score += 40;\n                    if (verificationData.linkedin_active) score += 30;\n                    if (verificationData.social_presence > 2) score += 20;\n                    if (verificationData.recent_activity) score += 10;\n                    return score;\n                  }\n                  \n                  function getRecommendedChannels(prospect, score) {\n                    const channels = [];\n                    if (score >= 80 && prospect.linkedin_url) channels.push(''linkedin_direct'');\n                    if (prospect.email_verified) channels.push(''email_personalized'');\n                    if (score >= 70 && prospect.phone) channels.push(''phone_outreach'');\n                    return channels.length > 0 ? channels : [''email_sequence''];\n                  }\n                  \n                  function extractPersonalizationData(prospect, companyData) {\n                    return {\n                      company_news: companyData.recent_news?.[0]?.title,\n                      technology_stack: companyData.technology_stack || [],\n                      recent_hires: companyData.job_postings?.length || 0,\n                      growth_signals: companyData.funding_events || [],\n                      personal_interests: prospect.linkedin_activity?.interests || []\n                    };\n                  }\n                "}, "typeVersion": 1}, {"id": "activecampaign_enrich", "name": "Email Intelligence & Validation", "type": "mcp-activecampaign", "position": [100, 500], "parameters": {"contacts": "{{ $json.qualified_prospects }}", "operation": "enrich_contact_data", "apply_tags": ["sam_ai_generated", "technology_sector", "high_intent"], "validate_emails": true, "segment_contacts": true, "check_engagement_history": true}, "typeVersion": 1}, {"id": "airtable_storage", "name": "Structured Prospect Storage", "type": "mcp-airtable", "position": [300, 500], "parameters": {"base_id": "{{ $env.AIRTABLE_PROSPECTS_BASE }}", "records": "{{ $json.qualified_prospects }}", "operation": "create_records", "table_name": "sam_enriched_prospects", "include_metadata": true, "auto_link_companies": true}, "typeVersion": 1}, {"id": "unipile_outreach", "name": "Multi-Channel Outreach Execution", "type": "mcp-unipile", "position": [500, 500], "parameters": {"channels": {"email": {"enabled": true, "subject": "Quick question about {{ company_name }}''s {{ technology_stack[0] }} infrastructure", "template": "sam_technology_personalized", "delay_after_linkedin": 2}, "phone": {"enabled": false}, "linkedin": {"enabled": true, "follow_up_delay": 3, "connection_message": "Hi {{ first_name }}, I noticed your work in {{ company_news }} at {{ company_name }}. Would love to connect and share some insights on {{ technology_stack[0] }} optimization."}}, "operation": "execute_multi_channel_outreach", "prospects": "{{ $json.qualified_prospects }}", "sequence_timing": "business_hours_only", "personalization_variables": ["first_name", "company_name", "company_news", "technology_stack", "recent_hires"]}, "typeVersion": 1}, {"id": "response_monitor", "name": "Response Monitoring & Analytics", "type": "webhook-response", "position": [700, 500], "parameters": {"channels": ["linkedin", "email", "phone"], "webhook_url": "{{ $env.SAM_RESPONSE_WEBHOOK_URL }}", "auto_categorize": true, "sentiment_analysis": true, "trigger_follow_ups": true, "listen_for_responses": true, "update_prospect_score": true}, "typeVersion": 1}], "connections": {"trigger": {"main": [[{"node": "websearch_boolean", "type": "main", "index": 0}]]}, "data_fusion": {"main": [[{"node": "activecampaign_enrich", "type": "main", "index": 0}, {"node": "airtable_storage", "type": "main", "index": 0}]]}, "apify_apollo": {"main": [[{"node": "brightdata_linkedin", "type": "main", "index": 0}]]}, "airtable_storage": {"main": [[{"node": "unipile_outreach", "type": "main", "index": 0}]]}, "unipile_outreach": {"main": [[{"node": "response_monitor", "type": "main", "index": 0}]]}, "websearch_boolean": {"main": [[{"node": "websearch_company", "type": "main", "index": 0}]]}, "websearch_company": {"main": [[{"node": "apify_apollo", "type": "main", "index": 0}]]}, "brightdata_company": {"main": [[{"node": "unipile_verification", "type": "main", "index": 0}]]}, "brightdata_linkedin": {"main": [[{"node": "brightdata_company", "type": "main", "index": 0}]]}, "unipile_verification": {"main": [[{"node": "data_fusion", "type": "main", "index": 0}]]}, "activecampaign_enrich": {"main": [[{"node": "unipile_outreach", "type": "main", "index": 0}]]}}}', 0, 28.50, 22.30, NULL, 12, '{"data_enrichment": "30_minutes", "initial_research": "15_minutes", "outreach_execution": "2_hours", "response_monitoring": "7_days"}', '{"email_body": "Hi {{ first_name }},\n\nI came across {{ company_news }} and was impressed by {{ company_name }}''s growth. \n\nGiven your background in {{ technology_stack }}, I thought you might be interested in how companies like {{ competitor_example }} have optimized their infrastructure during rapid scaling.\n\nWorth a 15-minute conversation?\n\nBest,\n{{ sender_name }}", "email_subject": "Quick question about {{ company_name }}''s {{ technology_stack[0] }} infrastructure", "follow_up_email": "Hi {{ first_name }},\n\nI know you''re busy scaling {{ company_name }}''s technology infrastructure. \n\nJust wanted to share a quick case study of how we helped {{ similar_company }} reduce costs by 40% while improving performance during their {{ growth_stage }} phase.\n\nRelevant for {{ company_name }}?\n\n{{ sender_name }}", "linkedin_follow_up": "Thanks for connecting, {{ first_name }}! I saw {{ company_name }} is hiring {{ recent_hires }} people. We''ve helped similar {{ industry }} companies reduce infrastructure costs by 40%. Worth a quick chat?", "linkedin_connection": "Hi {{ first_name }}, I noticed your work in {{ company_news }} at {{ company_name }}. Would love to connect and share some insights on {{ technology_stack[0] }} optimization."}', '["first_name", "last_name", "company_name", "job_title", "company_news", "technology_stack", "recent_hires", "growth_signals", "funding_stage", "competitor_example", "similar_company", "industry"]', true, true, NULL, '{complete_pipeline,mcp_integration,data_intelligence,technology}', '2025-09-23 22:20:37.945855', '2025-09-23 22:23:21.464719'),
	('b587e2b1-d26b-40d6-83ea-2f2e5f308990', 'product_launch', 'SAM Market-Driven Product Launch Funnel', 'Product launch funnel with competitive intelligence and market timing optimization', 'technology', 'product_manager', 'startup', 'sam-product-launch-v1', '{"nodes": [{"id": "competitive_intel", "name": "Competitive Market Intelligence", "type": "mcp-brightdata", "parameters": {"operation": "competitive_intelligence", "competitors": "{{ $json.competitor_list }}", "analysis_scope": ["product_releases", "pricing_changes", "feature_updates", "market_positioning"]}}, {"id": "market_timing", "name": "Market Timing Analysis", "type": "mcp-websearch", "parameters": {"industry": "{{ $json.target_industry }}", "operation": "market_timing_analysis", "timing_factors": ["seasonal_trends", "budget_cycles", "competitor_activity"], "product_category": "{{ $json.product_category }}"}}]}', 0, 26.70, 19.40, NULL, 10, NULL, NULL, NULL, true, false, NULL, '{product_launch,competitive_intel,market_timing,startup}', '2025-09-23 22:20:38.066317', '2025-09-23 22:23:21.575437'),
	('8ccbcd04-8bc5-46b8-8c7b-a158b7b0ebea', 'event_invitation', 'SAM Intelligent Event Invitation Funnel', 'AI-powered event invitation funnel with real-time intent detection and multi-channel follow-up', 'general', 'general', 'general', 'sam-intelligent-event-v1', '{"nodes": [{"id": "intent_detection", "name": "Event Intent Detection", "type": "mcp-websearch", "parameters": {"operation": "intent_detection_search", "search_terms": ["conference", "webinar", "training", "workshop", "event"], "intent_signals": ["recent_event_attendance", "learning_interests", "industry_events"], "target_personas": "{{ $json.target_personas }}"}}, {"id": "event_personalization", "name": "Event Content Personalization", "type": "function", "parameters": {"functionCode": "\n                  const prospects = $json.qualified_prospects;\n                  const eventDetails = $json.event_details;\n                  \n                  return prospects.map(prospect => ({\n                    ...prospect,\n                    personalized_invite: generateEventInvite(prospect, eventDetails),\n                    recommended_sessions: getRecommendedSessions(prospect, eventDetails),\n                    peer_attendees: findPeerAttendees(prospect, eventDetails.attendee_list)\n                  }));\n                "}}]}', 0, 32.10, 24.80, NULL, 8, NULL, NULL, NULL, true, true, NULL, '{events,intent_detection,multi_channel,ai_powered}', '2025-09-23 22:20:37.997512', '2025-09-23 22:23:21.523179');
