	('69caf5c5-0fe4-4cd3-aa06-53749c7d1c67', 'charissa-workspace', 'Charissa - LinkedIn Founder Outreach', 'LinkedIn-only campaign targeting early-stage founders', 'linkedin_only', 'ready', '{"email": false, "linkedin": true}', '{"account_id": "he3RXnROSLuhONxgNle7dw", "follow_up_message": "Hi {first_name}, I''ve been thinking about the early-stage founder reality - you''re probably wearing 10+ hats right now: product development, customer discovery, fundraising prep, AND trying to generate your first paying customers. The catch-22 is brutal: you need customers to show traction for investors, but you can''t afford to hire sales help, and the manual outreach eats up the time you need for building and fundraising. I''m curious - as a solo founder (or small team), what''s your biggest time sink right now? Finding customers, handling repetitive processes, or are you mostly focused on building?", "connection_message": "Hi {first_name}, I work for InnovareAI, an AI company known for its innovative workflow automation and AI agent solutions. I''m always interested in connecting with like-minded individuals who want to learn all things AI. Would you be open to connecting?"}', NULL, NULL, '2025-09-23 18:28:18.038737+00', '2025-09-23 18:28:18.231+00', NULL, NULL, 'sam_signature', '{}', '{}', NULL, NULL, NULL, NULL, NULL, '{}');
