INSERT INTO "public"."document_ai_analysis" ("id", "workspace_id", "document_id", "analysis_type", "model_used", "tags", "categories", "key_insights", "summary", "relevance_score", "metadata", "created_at") VALUES
	('65edb584-f45b-4045-8e13-a039160374e1', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', '7c6caf96-4736-49e2-80db-0a3b87d83126', 'seeded_content', 'manual-seed', '{ICP,targeting,playbook}', '{ICP,targeting,playbook}', '["Ideal prospects operate revenue teams of 15+ sellers and feel hiring pressure.", "Best-fit verticals: B2B SaaS, GTM agencies, RevOps consultancies, enterprise marketplaces.", "Buying signals include rapid SDR turnover, multi-channel outreach gaps, and heavy manual research."]', 'Defines the ideal customer profile for SAM AI including verticals, signals, and decision makers.', 0.92, '{"seedGroup": "sam-demo", "displayTitle": "SAM ICP Master Guide"}', '2025-09-26 15:08:18.523+00'),
	('916010e7-8772-4d4e-bb2e-bd2c921f8df1', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', '24b09668-3aa7-4a47-b76b-30e72f09fe38', 'seeded_content', 'manual-seed', '{product,features,architecture}', '{product,features,architecture}', '["SAM runs a consultant orchestrator that assigns work to specialized agents (prospecting, KB curation, messaging, approval).", "Channels: LinkedIn (via Unipile MCP), email (ReachInbox + Google/Microsoft), enrichment (Bright Data, Apify, Google CSE).", "Compliance: workspace isolation, Netlify + Supabase stack, optional HITL checkpoints at every stage."]', 'Explains SAM AIs orchestrated agent stack, channels, and compliance posture.', 0.92, '{"seedGroup": "sam-demo", "displayTitle": "SAM Product Overview"}', '2025-09-26 15:08:19.687+00'),
	('734c1bc3-4e1e-434b-a637-a8877cd6f441', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', '399d0582-23e5-4dab-8bd0-d4e7bfa5aeea', 'seeded_content', 'manual-seed', '{messaging,linkedin,email}', '{messaging,linkedin,email}', '["Each sequence begins with a consultant-style connect request referencing KB insights.", "Follow-ups blend ICP-specific pains (research debt, SDR turnover) with social proof.", "Messaging adapts to vertical (SaaS vs agency) by switching case studies and metrics."]', 'Provides the default LinkedIn + email outreach cadence and personalization levers.', 0.92, '{"seedGroup": "sam-demo", "displayTitle": "SAM Messaging Framework"}', '2025-09-26 15:08:20.155+00'),
	('258531c7-1316-41b2-8598-d5ca6df80907', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', '1424011e-1f1b-419d-a767-6c5e8b45cc90', 'seeded_content', 'manual-seed', '{objections,sales,enablement}', '{objections,sales,enablement}', '["Primary objections: We already use Apollo, AI feels risky, Need HITL, Data privacy.", "Talk tracks convert objection into benefit, then cite KB upload or case study.", "Always include fallback step: schedule 20-min GTM audit with Sam orchestrator."]', 'List of common buying objections with talk tracks and KB references.', 0.92, '{"seedGroup": "sam-demo", "displayTitle": "SAM Objection Handling Matrix"}', '2025-09-26 15:08:20.686+00'),
	('941c6d9f-d174-4518-8641-110ffc468fef', 'babdcab8-1a78-4b2f-913e-6e9fd9821009', '39379313-a408-43fe-aa2a-a41357c14e93', 'seeded_content', 'manual-seed', '{pricing,roi,financial}', '{pricing,roi,financial}', '["Core plans: Starter $99, Pro $399, Enterprise $1,999+ with add-ons.", "ROI framing: compare to SDR cost ($120k) and tooling stack consolidation.", "Implementation: 1-week onboarding with ICP + KB + go-live review."]', 'Breaks down plan tiers, ROI math, and implementation effort.', 0.92, '{"seedGroup": "sam-demo", "displayTitle": "SAM Pricing & ROI Cheat Sheet"}', '2025-09-26 15:08:21.17+00');
